export class AverageSessionModel {
	constructor(data) {
		this.id = data.userId;
		this.sessions = data.sessions;
	}

	getAverage() {
		this.sessions = this.sessions.map((session) => {
			return session.time;
		});

		return this.sessions.reduce((a, b) => a + b, 0) / this.sessions.length;
	}

